interface SkillsProps {
    skills: {
        img: string,
        name: string
    }[]
}

export const Skills: React.FC<SkillsProps> = ({ skills }) => {
    return (
        <section>
            <h1>My Skills</h1>
            { skills.map((skill: any) => 
                <article className="skill-card">
                    <img src={skill.img} alt={skill.name} />
                    <h5>{skill.name}</h5>
                </article>
            )}
        </section>
    )
}
